using System.Data.SQLite;

namespace CarsFunctionApp
{
    public static class SqLiteConnectionManager
    {
        private static SQLiteConnection _sqLiteConnection;

        public static SQLiteConnection GetConnection()
        {
            if (_sqLiteConnection != null) return _sqLiteConnection;

            _sqLiteConnection = new SQLiteConnection($"Data Source=:memory:;Version=3;");


            _sqLiteConnection.Open();

            using (var command = _sqLiteConnection.CreateCommand())
            {
                command.CommandText =
                    "BEGIN TRANSACTION;CREATE TABLE IF NOT EXISTS \"Photos\" (	\"Id\"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT UNIQUE,	\"ImageFile\"	TEXT NOT NULL,	\"CarId\"	INTEGER NOT NULL,	FOREIGN KEY(\"CarId\") REFERENCES \"Cars\"(\"Id\"));CREATE TABLE IF NOT EXISTS \"Cars\" (	\"Id\"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT UNIQUE,	\"IsNew\"	INTEGER NOT NULL,	\"Brand\"	TEXT NOT NULL,	\"Model\"	TEXT NOT NULL,	\"Year\"	INTEGER NOT NULL,	\"Price\"	REAL NOT NULL);COMMIT;";
                command.ExecuteNonQuery();
            }

            //INITIAL DATA
            using (var command = _sqLiteConnection.CreateCommand())
            {
                command.CommandText =
                    "BEGIN TRANSACTION;INSERT INTO \"Cars\" VALUES (1,1,'Toyota','Corolla',1995,200000.0), (2,0,'Toyota','Camry',1995,200000.0), (3,1,'Honda','Accord',1995,200000.0), (4,0,'Conda','Civic',1997,150000.0), (6,1,'Toyota','Corolla',1995,200000.0);COMMIT;";
                command.ExecuteNonQuery();
            }
            using (var command = _sqLiteConnection.CreateCommand())
            {
                command.CommandText =
                    "BEGIN TRANSACTION;INSERT INTO \"Photos\" VALUES (1,'data:image/jpeg;base64,',3);COMMIT;";
                command.ExecuteNonQuery();
            }

            return _sqLiteConnection;
        }

    }
}
